import React from "react";

const Showrombooks = (props) => {
    console.log("tuj", props)
    return (
        <div className="data-display" style={divStyle}>
            <h2 style={h2Style}>{data.label}</h2>
            <p style={pStyle}>{data.abstract}</p>
            <div className="authors" style={authorsStyle}>
                <h3>Authors:</h3>
                <div className="author-list">
                    {data.authors.map((author, index) => (
                        <div
                            key={index}
                            style={{
                                backgroundColor: index % 2 === 0 ? '#ccc' : '#bbb',
                                color: index % 2 === 0 ? '#fff' : '#333',
                                padding: '5px 10px',
                                borderRadius: '5px',
                                marginRight: '5px',
                                marginBottom: '5px',
                                flexGrow: '1',
                                flexBasis: 'calc(50% - 5px)',
                                boxSizing: 'border-box',
                            }}
                        >
                            {author}
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Showrombooks;
